NOTE.Documentation_plain:
Récupère les valeurs des paramètres 'nrmId' et 'lnsServiceToDelete' dans la table CMD_PARAMETRES.
Si la valeur du paramètre 'lnsServiceToDelete' est vide, on retourne 'RAF',
sinon, appel à la procédure stockée de CS0 :  :ret := CS.delete_lns_from_user(:userId, :nrmId);

Utilise la valeur du paramètre 'nrmId' de la table CMD_PARAMETRES.
Fait appel à la procédure stockée de CS0: :ret := CS.get_attributes_from_nrmid( :userId, :nrmId, :serviceName, :curs ); 
Crée ou met à jour la valeur du paramètre 'lnsServiceToDelete' dans la table CMD_PARAMETRES.
